/*引入Vue*/
import Vue from 'vue'
/*引入App*/
import App from './App.vue'
/*关闭Vue的生产提示*/
Vue.config.productionTip = false
/*引入VueRouter*/
import VueRouter from "vue-router";
import router from './router'
Vue.config.productionTip=false
/*使用VueRouter插件*/
Vue.use(VueRouter)
/*创建vm*/
new Vue({
	el:'#app',
	render: h => h(App),
	router
})
